import Foundation

let base64EncodedInput = ""

struct Triangle {
    var side1: Int
    var side2: Int
    var side3: Int
    
    var isValid: Bool {
        return (side1 + side2) > side3 &&
            (side2 + side3) > side1 &&
            (side1 + side3) > side2
    }
}


let inputData = Data(base64Encoded: base64EncodedInput)!

let inputDecodedString = String(data: inputData, encoding: .utf8)!

let rows = inputDecodedString.characters.split { $0 == "\n" || $0 == "\r\n" }.map(String.init)

var column1 = [String]()
var column2 = [String]()
var column3 = [String]()

for row in rows {
    let values = row.components(separatedBy: "  ").filter { $0 != "" }
    
    
    guard values.count == 3 else {
        fatalError()
    }
    
    column1.append(values[0])
    column2.append(values[1])
    column3.append(values[2])
    
}

let chunkSize = 3

var validCount = 0
var invalidCount = 0

for column in [column1, column2, column3] {
    
    let chunks = stride(from: 0, to: column.count, by: chunkSize).map {
        Array(column[$0..<min($0 + chunkSize, column.count)])
    }
    
    for chunk in chunks {
    
        // remove whitespaces and map to int
        
        let intSides = chunk.map { Int($0.replacingOccurrences(of: " ", with: ""))! }
    
        let t = Triangle(side1: intSides[0], side2: intSides[1], side3: intSides[2])
        
        if t.isValid {
            validCount += 1
        } else {
            invalidCount += 1
        }
    }
}

print(validCount)
print(invalidCount)
